style.css:
@-moz-document url("https://www.google.com") {
#hplogo {
        display: none;
    }
    
    body::before {
        content: "4Life";
        font-size: 100px;
        color: #4285F4; 
        display: block;
        position: absolute;
        top: 180px; 
        left: 50%;
        transform: translateX(-50%);
        font-family: 'Arial', sans-serif;
        font-weight: bold;
    }
}
